<body>
    <script>
        async function generateIcons(url, name, className) {
            let iconList = [];
            await fetch(url)
                .then(res => res.text())
                .then(res => {
                    iconList = res.split("\n");
                });
            let html = `<h2>${name}</h2>`;
            html += "<div class=icons>"
            iconList.forEach(icon => {
                html += `<span class='${className} fa-${icon}' title="${icon}"></span>`;
            });
            html += "</div>"
            const frag = document.createDocumentFragment();
            const section = document.createElement('section');
            section.innerHTML = html;
            frag.appendChild(section);
            document.body.appendChild(frag);
        }

        generateIcons("./icon-brands.txt", "Brands", "fab");

        [["Light", "fal"], ["Regular", "far"], ["Troncho", "fa"]].forEach(style => {
            generateIcons("./icons.txt", style[0], style[1])
        });
    </script>
